<?php
/**
 * Phalcon version and installation test script
 * @see http://phalconphp.com
 * @see http://phalcon.io
 * @author Rich Milns (@richmilns)
 */
// output logo
echo '<img src="data:image/png;base64," width="100" style="display:block;margin:40px auto 0 auto">';
echo '<div style="text-align:center">';
// check we have Phalcon ext loaded
if (extension_loaded('phalcon')) {
	// create a micro app to test we can access Phalcon classes
	$app = new Phalcon\Mvc\Micro();
	$app->get('/', function () {
		echo "<h1 style='font-family:arial'>You're flying with Phalcon</h1>";
		echo "<p style='font-family:arial'>" . Phalcon\Version::get() . " is installed correctly for PHP " . phpversion() . "</p>";
	});
	// dispatch app
	$app->handle();
} else {
	// failed to find Phalcon extension
	echo "<h1 style='font-family:arial'>Error</h1>";
	echo "<p style='font-family:arial'>Phalcon PHP extension was not found - please make sure you have added extension=phalcon.so to php.ini</p>";
}
echo '</div>';
